import React from "react";
import { Route } from "react-router-dom";
import ToDoList from "./ToDoList";
import Update from "./Update";

function App(){
    return (
        <div>
            <Route component={ToDoList} exact path="/" />
            <Route component={Update} exact path="/about" />
        </div>
        

    )
}

export default App;
